export default function DamageChars() {
    const damageChars = [
        'Ashe',
        'Bastion',
        'Cassidy',
        'Echo',
        'Genji',
        'Hanzo',
        'Junkrat',
        'Mei',
        'Pharah',
        'Reaper',
        'Sojourn',
        'Soldier: 76',
        'Sombra',
        'Symmetra',
        'Tracer',
        'Widowmaker'
    ];

    return (
        <>
        <h2>Damage Characters</h2>
        {damageChars.map((damage, index) => {
            <label key={index}>{damage}</label>
        })}

        {characters.map((character, index) => (
            <label key={index}>{character}</label>
          ))}
        </>
    );
}
